import React from "react";
import Navbar from './components/NavBar/Navbar.jsx'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Home from './components/Pages/Home.jsx'



function App() {

  return (
    <Router>
      <div>
        <Navbar/>
        <Switch>
          <Route path='/'>
            <Home />
          </Route>
          <Route></Route>
          <Route></Route>
          </Switch>
      </div>
    </Router>
  );
}


export default App;
